text:
@regran_ed from @unwomen -  huge congratulations to 2018 #nobelpeaceprize laureate, nadia murad, who has been a brave and powerful voice for survivors of human trafficking and victims of sexual violence. in 2014, at the age of 19, murad was kidnapped in iraq, held hostage, and constantly subjected to sexual violence. after escaping 3 months of captivity, she started seeking justice for victims everywhere, telling her story to the world time and again, even though that meant reliving horrific memories of abuse and suffering. thank you nadia, for your courage to speak up and seek justice, not just for yourself, but for all survivors of sexual violence.
.
#nobelprize #endrapeinwar #nadiamurad #metoo - #regrann

